  false,\n\t\"url\": null,\n\t\"notes\": \"The Analog Marine Geophysical Underway
  data file consists primarily of seismic data and some bathymetry, magnetics, and
  gravity data. Most of the data are released to NGDC in microform packages; microfilm,
  microfiche exceptions include deep penetration seismic record sections and maps
  released in full or half scale. The data cover approximately 5 million miles of
  worldwide oceans and have been collected by various academic institutions, government
  agencies and foreign governments. Data are quality checked, master and backup copies
  produced and disseminated upon request. These seismic data include Lease Sale (LS)
  data which are a collection of marine geophysical data in a particular area and
  common depth point (CDP) data consisting of multichannel high-resolution underway
  seismic records. Shot-point navigation and occasionally annotated bathymetry accompany
  the seismic data. The data were released mainly from the US Geological Survey (USGS),
  and the Minerals Management Service (MMS). Output Media: sections, maps, 35-mm microfilm,
  magnetic tapes, text and microfiche. In most cases, the microfilm has been scanned
  and data available as tiff images.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
